import React from "react";

function Login() {
  return (
    <div>
      Login
      <br />
      <div>
        UserName
        <br />
        <input type="text" />
      </div>
      <div>
        PassWord
        <br />
        <input type="password" />
      </div>
      <div>
        <input type="button" />
      </div>
    </div>
  );
}

export default Login;
